import { StrictMode } from 'react'
import type { AppProps } from 'next/app'
import CssBaseline from '@material-ui/core/CssBaseline'

function NextApp({ Component, pageProps }: AppProps) {
  return (
    <StrictMode>
      <CssBaseline />
      <Component {...pageProps} />
    </StrictMode>
  )
}

export default NextApp
